BEGIN TRANSACTION;
CREATE TABLE activity (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            source TEXT NOT NULL,
            type TEXT NOT NULL,
            timestamp DATETIME DEFAULT CURRENT_TIMESTAMP,
            data TEXT,
            created_at DATETIME DEFAULT CURRENT_TIMESTAMP
        , session_id TEXT DEFAULT NULL, project_name TEXT DEFAULT NULL, machine_id TEXT DEFAULT 'Jordans-Mac-mini.local', efficiency REAL DEFAULT 0.0, tokens_used INTEGER DEFAULT 0, cost_estimate REAL DEFAULT 0.0);
CREATE TABLE metrics (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            metric_name TEXT NOT NULL,
            metric_value REAL NOT NULL,
            source TEXT,
            timestamp DATETIME DEFAULT CURRENT_TIMESTAMP
        );
CREATE TABLE sessions (
            session_id TEXT PRIMARY KEY,
            project TEXT,
            started_at DATETIME,
            last_activity DATETIME,
            message_count INTEGER DEFAULT 0,
            token_count INTEGER DEFAULT 0
        );
CREATE INDEX idx_activity_timestamp ON activity(timestamp);
CREATE INDEX idx_activity_source_type ON activity(source, type);
CREATE VIEW session_analytics AS
            SELECT 
                session_id,
                MIN(timestamp) as session_start,
                MAX(timestamp) as session_end,
                COUNT(*) as message_count,
                SUM(tokens_used) as total_tokens,
                AVG(efficiency) as avg_efficiency,
                SUM(cost_estimate) as total_cost,
                source,
                project_name,
                machine_id,
                (julianday(MAX(timestamp)) - julianday(MIN(timestamp))) * 24 * 60 as duration_minutes
            FROM activity 
            WHERE session_id IS NOT NULL
            GROUP BY session_id, source, project_name, machine_id;
CREATE VIEW daily_summary AS
            SELECT 
                date(timestamp) as day,
                source,
                machine_id,
                COUNT(*) as activities,
                COUNT(DISTINCT session_id) as unique_sessions,
                SUM(tokens_used) as total_tokens,
                AVG(efficiency) as avg_efficiency,
                SUM(cost_estimate) as total_cost
            FROM activity 
            GROUP BY date(timestamp), source, machine_id
            ORDER BY day DESC;
CREATE VIEW productivity_patterns AS
            SELECT 
                strftime('%w', timestamp) as day_of_week,
                strftime('%H', timestamp) as hour,
                COUNT(*) as activity_count,
                AVG(tokens_used) as avg_tokens,
                COUNT(DISTINCT session_id) as session_count
            FROM activity 
            WHERE timestamp > datetime('now', '-30 days')
            GROUP BY day_of_week, hour
            ORDER BY activity_count DESC;
DELETE FROM "sqlite_sequence";
COMMIT;
